"use server";
import { GoogleGenAI, Type } from "@google/genai";

export async function main({ pdfData }: { pdfData: string }) {
  const ai = new GoogleGenAI({
    apiKey: process.env.GEMINI_API_KEY,
  });
  const config = {
    temperature: 0.15,
    thinkingConfig: {
      thinkingBudget: 0,
    },
    responseMimeType: "application/json",
    responseSchema: {
      type: Type.OBJECT,
      required: ["subjects"],
      properties: {
        subjects: {
          type: Type.ARRAY,
          items: {
            type: Type.OBJECT,
            required: ["id", "subject_name", "modules"],
            properties: {
              id: {
                type: Type.NUMBER,
              },
              subject_name: {
                type: Type.STRING,
              },
              modules: {
                type: Type.ARRAY,
                items: {
                  type: Type.OBJECT,
                  required: ["module_id", "module_name"],
                  properties: {
                    module_id: {
                      type: Type.NUMBER,
                    },
                    module_name: {
                      type: Type.STRING,
                    },
                  },
                },
              },
            },
          },
        },
      },
    },
    systemInstruction: [
      {
        text: `You are a Head of Department of a Undergraduate or Graduate College, you are presented with a syllabus PDF which will contain Multiple Subject Names, Each Subject Can Contain Multiple Modules. Your task is to identify each subject_name, and each module_name. 

In the Final JSON, subject_name will be the title of the subject and module_name will be the first few bold/highlighted words until the last bold/highlighted word of the module content, don't include anything after the bold/highlighted part. For each subject, all modules for it might be spread across on several consecutive pages, make sure to include all modules under a subject.
subject_name or module_name should not be longer than 10 words, in that case, summarise it. id and module_id should start with 0 (integer), increment by 1 for each subject or modules.

Response with ONLY JSON`,
      },
    ],
  };
  const model = "gemini-2.5-flash-lite";
  const contents = [
    {
      role: "user",
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `application/pdf`,
          },
        },
      ],
    },
    {
      role: "model",
      parts: [
        {
          text: `{
  "subjects": [
    {
      "id": 0,
      "modules": [
        {
          "module_id": 0,
          "module_name": "Introduction: Principles of design of reinforced concrete members"
        },
        {
          "module_id": 1,
          "module_name": "Working stress method of design: Basic concepts and IS code"
        },
        {
          "module_id": 2,
          "module_name": "Limit state method of design: Basic concepts and IS code"
        },
        {
          "module_id": 3,
          "module_name": "Beam Design by LSM: Analysis, design and detailing"
        },
        {
          "module_id": 4,
          "module_name": "Slab Design by LSM : Design and detailing of one-way and two-way slab"
        },
        {
          "module_id": 5,
          "module_name": "Continuous slab and beam design by LSM: Design and detailing"
        },
        {
          "module_id": 6,
          "module_name": "Design of Staircases by LSM: Types; Design and detailing"
        },
        {
          "module_id": 7,
          "module_name": "Design of Columns by LSM: Design and detailing of reinforced concrete short columns"
        },
        {
          "module_id": 8,
          "module_name": "Design of Foundation by LSM: Design and detailing of reinforced concrete isolated square"
        }
      ],
      "subject_name": "DESIGN OF RCC STRUCTURES"
    },
    {
      "id": 1,
      "modules": [
        {
          "module_id": 0,
          "module_name": "Basics of Structural Analysis: Concept of static and kinematic indeterminacy"
        },
        {
          "module_id": 1,
          "module_name": "Analysis of Determinate Structures: Portal Frames, Three hinged arches, Cables"
        },
        {
          "module_id": 2,
          "module_name": "Deflection of Determinate Structures: Energy methods. Unit Load method"
        },
        {
          "module_id": 3,
          "module_name": "Influence Line Diagram: Statically determinate beams and trusses"
        },
        {
          "module_id": 4,
          "module_name": "Analysis of Statically Indeterminate Beams: Theorem of three moments"
        },
        {
          "module_id": 5,
          "module_name": "Influence Line Diagram for Indeterminate Structures: Muller  Breslauprinciple"
        }
      ],
      "subject_name": "STRUCTURAL ANALYSIS  I"
    }
  ]
}`,
        },
      ],
    },
    {
      role: "user",
      parts: [
        {
          inlineData: {
            data: pdfData,
            mimeType: `application/pdf`,
          },
        },
      ],
    },
  ];

  const response = await ai.models.generateContentStream({
    model,
    config,
    contents,
  });
  let fileIndex = 0;
  let total = "";
  for await (const chunk of response) {
    total += chunk.text;
  }
  return JSON.parse(total);
}
